import React, { useEffect, useState } from 'react';
import { AuthContext } from '../AuthContext';
import { useNavigate } from 'react-router-dom';

export default function Newrek() {
    const [rekening, setRekening] = useState([]);
    const history = useNavigate();
    const { isUserAuthenticated, idU, logoutU } = React.useContext(AuthContext);

    if (!isUserAuthenticated) {
        history('/login-user');
    }

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch('http://localhost:3000/rekening'); // Endpoint API Express
                if (!response.ok) {
                    throw new Error('Gagal mendapatkan data rekening');
                }
                const data = await response.json();
                setRekening(data);
                console.log(data);
            } catch (error) {
                console.error('Error:', error);
            }
        };
        fetchData();
    }, []);

    function handleInput(event) {
        const numberInput = document.getElementById('numberInput');
        const hiddenInput = document.getElementById('hiddenInput');
        hiddenInput.value = numberInput.value.replace(/\D/g, '').replace(/./g, '*');
    }

    return (
        <div class="container-fluid">
            <div class="row">
                <nav class="navbar navbar-expand-lg sticky-top bg-primary navbar-dark">
                    <div class="container">
                        <a class="navbar-brand" >Dashboard User</a>
                        <ul class="navbar-nav ms-auto mb-2 mb-lg-0">

                            <li class="nav-item">
                                <a class="btn bg-white text-primary ms-4 hover:bg-sky-900" onClick={logoutU}>Sign Out</a>
                            </li>
                        </ul>
                    </div>
                </nav>
                <nav id="sidebar" class="col-md-3 col-lg-2 d-md-block bg-cyan-950 h-screen  sidebar">
                    <div class="sidebar-sticky pt-3">
                        <ul class="nav flex-column">
                            <li class="nav-item">
                                <a class="nav-link text-white text-primary " aria-current="page" href="/dashboard-user">
                                    All Account
                                </a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link text-white text-primary active" href="/dashboard-user/create">
                                    Create Account
                                </a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link text-white text-primary" href="manage-games.html">
                                    Manage Games
                                </a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link text-white text-primary" href="profile.html">
                                    User Profile
                                </a>
                            </li>
                        </ul>
                    </div>
                </nav>

                <main class="col-md-9 ms-sm-auto col-lg-10 px-md-4">
                    <form >

                        <div>
                            <label htmlFor="numberInput">Enter Number:</label>
                            <input
                                type="number"
                                id="numberInput"
                                value={number}
                                onChange={handleInputChange}
                            />
                            <input
                                type="text"
                                id="hiddenInput"
                                className="hidden-input"
                                value={hiddenValue}
                                readOnly
                            />
                        </div>

                        {/* <div class="form-group my-3">
                            <label for="username" class="mb-1 text-muted">Username</label>
                            <input type="text" id="username" name="username" value={username} onChange={(e) => setUsername(e.target.value)} class="form-control" autofocus />
                        </div>

                        <div class="form-group my-3">
                            <label for="password" class="mb-1 text-muted">Password</label>
                            <input type="password" id="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} class="form-control" />
                        </div> */}

                        <div class="mt-4 row">
                            <div class="col">
                                <button type="submit" class="btn btn-primary w-100">Login</button>
                            </div>
                        </div>
                    </form>
                </main>
            </div>
        </div>


    );
}
